/*Table structure for table `realtors` */

DROP TABLE IF EXISTS `realtors`;

CREATE TABLE `realtors` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `neighborhood_id` bigint(20) unsigned DEFAULT NULL,
  `name` varchar(300) NOT NULL,
  `cpf` varchar(14) NOT NULL,
  `rg` varchar(14) NOT NULL,
  `civil_status` tinyint(1) NOT NULL,
  `zip_code` varchar(9) DEFAULT NULL,
  `address` varchar(500) NOT NULL,
  `number` int(5) DEFAULT NULL,
  `complement` int(5) DEFAULT NULL,
  `email` varchar(300) NOT NULL,
  `cellphone` varchar(20) DEFAULT NULL,
  `phone` varchar(20) NOT NULL,
  `phone2` varchar(20) DEFAULT NULL,
  `created` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `removed` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;

